import {useEffect, useState} from 'react'
import axios from "axios";
import Card from './Card';
function Photo() {
    const [myphoto,setmyPhoto]=useState([]);
    async function fetchData() {
       await axios.get('https://api.slingacademy.com/v1/sample-data/photos?offset=0&limit=20').then((res)=>{
        setmyPhoto(res.data.photos)
    })
    }
    useEffect(()=>{
        fetchData();
    },[])
    return(
        <div>
         {myphoto?.map((n)=>(
            <Card img={n.url} id={n.id} description={n.description}/>
         ))}
        </div>
    );
}

export default Photo;
